import React from 'react';
import {SwapiConsumer} from "../../SwapiServiceContext";

export const WithSwapi = (WrapperComponent) => {
    return props =>
        <SwapiConsumer>
            {
                swapiService => <WrapperComponent {...props} swapiService={swapiService}/>
            }
        </SwapiConsumer>
}
